Download the Parc Astérix app for free and enjoy a unique experience  with many features. This application will allow you to prepare your visit with friends or family and to bookmark your favorite attractions. She will with you all day long.

Before your visit:
- Get all the information about our attractions and shows;
- Create your profile to find your favorites, your attractions already made and your reservations on the Parc Astérix mobile application;
- Bookmark your favorite attractions on the website and you will easily find them on the application during your visit;
- Book your entrance tickets from the application.

The day of your visit:
- Discover the new map of the Park and move around more easily thanks to a geolocation system;
- Quickly access all the information on attractions, shows and services close to you, thanks to the descriptive sheets attached to the plan numbers;
- Consult the waiting times of your favorite attractions and the schedules of the next shows to optimize your visit;
- Filter our attractions according to the type of sensations, the size required or the waiting time;
- Online catering service will allow you to more easily book your meal and receive your order at the dedicated priority cash desks (Fastes de Rome, Caius, La Halte des Chevaliers, Relais Gaulois, Restaurant du Lac , the Taverne de Dionysos, la Guinguette).

Make the most of your visit with this free application, and adopt the "Touche Gauloise".

Enjoy your visit!
